(7, 0, 423492, 3, 'N', 'R3B03Q001', 'Berapa banyak pegawai yang saat ini menempati kantor BPS di satuan kerja bapak/ibu/saudara/i?', '', '<p style=\"text-align:justify;margin:0cm;\"><span style=\"font-size:11pt;\"><span style=\"line-height:115%;\"><span style=\"font-family:Arial, sans-serif;\"><span lang=\"en\" style=\"font-size:12pt;\" xml:lang=\"en\"><span style=\"line-height:115%;\"><span style=\"font-family:\'Times New Roman\', serif;\">Isikan dengan banyaknya pegawai yang menempati kantor BPS di satuan kerja tersebut, mencakup ASN (PNS dan PPPK) dan Honorer (non-PNS, non-PPPK, tidak termasuk mitra).</span></span></span></span></span></span></p>\n', 'N', 'Y', 1, 'en', 0, 0, '1', ''),
(7, 0, 423492, 3, 'N', 'R3B03Q001', 'Berapa banyak pegawai yang saat ini menempati kantor BPS di satuan kerja bapak/ibu/saudara/i?', '', '<p style=\"text-align:justify;margin:0cm;\"><span style=\"font-size:11pt;\"><span style=\"line-height:115%;\"><span style=\"font-family:Arial, sans-serif;\"><span lang=\"en\" style=\"font-size:12pt;\" xml:lang=\"en\"><span style=\"line-height:115%;\"><span style=\"font-family:\'Times New Roman\', serif;\">Isikan dengan banyaknya pegawai yang menempati kantor BPS di satuan kerja tersebut, mencakup ASN (PNS dan PPPK) dan Honorer (non-PNS, non-PPPK, tidak termasuk mitra).</span></span></span></span></span></span></p>\n', 'N', 'Y', 1, 'id', 0, 0, '1', ''),
(8, 0, 423492, 3, 'N', 'R3B03Q002', '<p>Berapa banyak pegawai yang saat ini termasuk dalam kelompok rentan di satuan kerja bapak/ibu/saudara/i?</p>\n\n<p><!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b03q002\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung--></p>\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b03q002\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\"></span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<p>Cakupan dari kelompok rentan:</p>\n\n<ol>\n	<li>Lanjut usia (lansia) adalah seseorang yang telah mencapai usia 60 tahun keatas.</li>\n	<li>Wanita hamil/ibu hamil adalah seorang perempuan yang sedang mengandung .</li>\n	<li>Penyandang disabilitas, meliputi penyandang disabilitas fisik (contoh : tidak dapat berjalan seperti orang normal, tuna rungu) dan gangguan perilaku/emosional.</li>\n</ol>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 2, 'en', 0, 0, '1', ''),
(8, 0, 423492, 3, 'N', 'R3B03Q002', '<p>Berapa banyak pegawai yang saat ini termasuk dalam kelompok rentan di satuan kerja bapak/ibu/saudara/i?</p>\n\n<p><!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b03q002\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung--></p>\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b03q002\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\"></span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<p>Cakupan dari kelompok rentan:</p>\n\n<ol>\n	<li>Lanjut usia (lansia) adalah seseorang yang telah mencapai usia 60 tahun keatas.</li>\n	<li>Wanita hamil/ibu hamil adalah seorang perempuan yang sedang mengandung .</li>\n	<li>Penyandang disabilitas, meliputi penyandang disabilitas fisik (contoh : tidak dapat berjalan seperti orang normal, tuna rungu) dan gangguan perilaku/emosional.</li>\n</ol>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 2, 'id', 0, 0, '1', ''),
(9, 0, 423492, 3, 'F', 'R3B03Q003', '<p>Wilayah satuan kerja Bapak/Ibu/Saudara/i :</p>\n\n<p><!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b03q003\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung--></p>\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b03q003\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\"></span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<ul>\n	<li>Pesisir\n	<p>Suatu daerah akan dikategorikan sebagai wilayah pesisir apabila berjarak paling jauh 12 mil atau 19.3121 km dari perairan</p>\n	</li>\n	<li>Dekat dengan Sungai\n	<p>Daerah dapat dikatakan dekat sungai saat garis sempadan bangunan terhadap sungai (sempadan sungai):</p>\n\n	<ol>\n		<li>Garis sempadan pada sungai tidak bertanggul di dalam kawasan perkotaan ditentukan:\n		<ul>\n			<li>paling sedikit berjarak 10 meter dari tepi kiri dan kanan palung sungai sepanjang alur sungai, dalam hal kedalaman sungai kurang dari atau sama dengan 3 meter;</li>\n			<li>paling sedikit berjarak 15 meter dari tepi kiri dan kanan palung sungai sepanjang alur sungai, dalam hal kedalaman sungai lebih dari 3 meter sampai dengan 20 meter; dan</li>\n			<li>paling sedikit berjarak 30 meter dari tepi kiri dan kanan palung sungai sepanjang alur sungai, dalam hal kedalaman sungai lebih dari 20 meter.</li>\n		</ul>\n		</li>\n		<li>Garis sempadan pada sungai tidak bertanggul di luar kawasan perkotaan ditentukan:\n		<ul>\n			<li>Garis sempadan sungai besar (luas DAS lebih besar dari 500 km2) tidak bertanggul di luar kawasan perkotaan ditentukan paling sedikit berjarak 100 meter dari tepi kiri dan kanan palung sungai sepanjang alur sungai.</li>\n			<li>Garis sempadan sungai kecil (luas DAS kurang dari atau sama dengan 500 km2) tidak bertanggul di luar kawasan perkotaan ditentukan paling sedikit 50 meter dari tepi kiri dan kanan palung sungai sepanjang alur sungai.</li>\n		</ul>\n		</li>\n		<li>Garis sempadan sungai bertanggul di dalam kawasan perkotaan ditentukan paling sedikit berjarak 3 meter dari tepi luar kaki tanggul sepanjang alur sungai.</li>\n		<li>Garis sempadan sungai bertanggul di luar kawasan perkotaan ditentukan paling sedikit berjarak 5 meter dari tepi luar kaki tanggul sepanjang alur sungai.</li>\n	</ol>\n	</li>\n	<li>Dataran Tinggi\n	<p>Dataran tinggi merupakan bagian permukaan bumi yang mendatar dan terletak pada ketinggian lebih dari 600 m di atas permukaan laut.</p>\n	</li>\n	<li>Dekat Gunung Api\n	<p>Gunung api yang dimaksud adalah gunung api aktif. Daerah dekat gunung api merupakan daerah rawan dengan radius  18 km.</p>\n	</li>\n</ul>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 3, 'en', 0, 0, '1', ''),
