(10, 0, 423492, 3, 'F', 'R3B03Q004', '<p>Sejak satuan kerja Bapak/Ibu/Saudara/I didirikan, apakah pernah mengalami kerugian fisik atau nonfisik yang disebabkan oleh bencana berikut?</p>\n\n<p><!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b03q004\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung--></p>\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b03q004\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\"></span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<ol>\n	<li>Kerugian fisik mencakup kerugian keseluruhan ataupun sebagian sarana fisik berupa bangunan, fasilitas, infrastruktur, instalasi, peralatan, mesin, perlengkapan, perabotan, dan sebagainya akibat bencana.</li>\n	<li>Kerugian bersifat non fisik, berupa pengeluaran atau biaya dalam penyediaan pelayanan kesehatan dan/atau kurangnya pelayanan kesehatan akibat kebutuhan yang meningkat atau ketersediaan yang menurun.</li>\n</ol>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 4, 'en', 0, 0, '1', ''),
