(21, 0, 423492, 8, 'L', 'R3B04Q022', 'Apakah satuan kerja Bapak/Ibu/Saudara/i mengalokasikan dana untuk penanggulangan bencana baik dana dari APBN maupun luar APBN (iuran, sukarela, sumbangan)?', '', '<p style=\"margin-top:12pt;margin-right:0cm;margin-bottom:12pt;margin-left:0cm;text-align:justify;margin:0cm;\"><span style=\"font-size:11pt;\"><span style=\"line-height:150%;\"><span style=\"font-family:Arial, sans-serif;\"><span lang=\"en\" style=\"font-size:12pt;\" xml:lang=\"en\"><span style=\"line-height:150%;\"><span style=\"font-family:\'Times New Roman\', serif;\">Isikan Ya jika satuan kerja Anda mengalokasikan dana untuk penanggulangan bencana baik dana dari APBN maupun luar APBN (iuran, sukarela, sumbangan). </span></span></span></span></span></span></p>\n', 'N', 'Y', 2, 'en', 0, 0, '1', ''),
(21, 0, 423492, 8, 'L', 'R3B04Q022', 'Apakah satuan kerja Bapak/Ibu/Saudara/i mengalokasikan dana untuk penanggulangan bencana baik dana dari APBN maupun luar APBN (iuran, sukarela, sumbangan)?', '', '<p style=\"margin-top:12pt;margin-right:0cm;margin-bottom:12pt;margin-left:0cm;text-align:justify;margin:0cm;\"><span style=\"font-size:11pt;\"><span style=\"line-height:150%;\"><span style=\"font-family:Arial, sans-serif;\"><span lang=\"en\" style=\"font-size:12pt;\" xml:lang=\"en\"><span style=\"line-height:150%;\"><span style=\"font-family:\'Times New Roman\', serif;\">Isikan Ya jika satuan kerja Anda mengalokasikan dana untuk penanggulangan bencana baik dana dari APBN maupun luar APBN (iuran, sukarela, sumbangan). </span></span></span></span></span></span></p>\n', 'N', 'Y', 2, 'id', 0, 0, '1', ''),
(22, 0, 423492, 8, 'M', 'R3B04Q023', 'Bagaimanakah bentuk pendanaan untuk penanggulangan bencana tersebut?\n<style type=\"text/css\">.kondef {\n        margin-left: 10px;\n        width: 20px;\n        height: 20px;\n        border-radius: 50%;\n        outline: none;\n        border: none;\n        color: white;\n        background-color: #072438;\n    }\n\n    .kondef:focus {\n        outline: none;\n        border: none;\n    }\n\n    .kondef:active {\n        outline: none;\n        border: none;\n    }\n</style>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#423\" data-toggle=\"modal\" type=\"button\">?</button> <!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n<div aria-hidden=\"true\" aria-labelledby=\"exampleModalLabel\" class=\"modal fade\" id=\"423\" tabindex=\"-1\">\n<div class=\"modal-dialog\">\n<div class=\"modal-content\">\n<div class=\"modal-header\">\n<h5 class=\"modal-title font-weight-bold\" id=\"exampleModalLabel\"><strong>Konsep dan Definisi</strong></h5>\n</div>\n<!--Yang di dalam modal-body untuk isinya (ini yang diganti)-->\n\n<div class=\"modal-body\">\n<ol>\n	<li>Alokasi dana pra bencana adalah dana yang digunakan untuk pencegahan dini dan penanggulangan korban bencana seperti biaya untuk melakukan pelatihan menghadapi bencana, biaya penyediaan alat-alat keselamatan standar, biaya diklat manajemen penanggulangan bencana, dan sebagainya.</li>\n	<li>Alokasi dana tanggap darurat adalah dana yang siap dipakai dan digunakan untuk pencarian dan penyelamatan korban bencana, pertolongan darurat, evakuasi korban bencana, kebutuhan air bersih dan sanitasi, pangan, sandang, pelayanan kesehatan, serta penampungan dan tempat hunian sementara.</li>\n	<li>Alokasi dana pasca bencana adalah dana yang digunakan untuk melakukan kegiatan rehabilitasi dan rekonstruksi setelah terjadinya bencana sebagai upaya pemulihan kembali seperti keadaan sedia kala.</li>\n</ol>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-primary\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 3, 'en', 0, 0, '(((!is_empty(423492X8X21.NAOK) && (423492X8X21.NAOK == 1))))', '');
