(24, 0, 423492, 4, 'F', 'R3B04Q018', '<p>Saat ini, apakah satuan kerja Bapak/Ibu/Saudara/i memiliki tata letak dan lokasi khusus untuk melindungi fasilitas dan properti khusus ketika terjadi bencana?\n<style type=\"text/css\">.kondef {\n        margin-left: 10px;\n        width: 20px;\n        height: 20px;\n        border-radius: 50%;\n        outline: none;\n        border: none;\n        color: white;\n        background-color: #072438;\n    }\n\n    .kondef:focus {\n        outline: none;\n        border: none;\n    }\n\n    .kondef:active {\n        outline: none;\n        border: none;\n    }\n</style>\n</p>\n\n<p><span style=\"font-family:Trebuchet MS,Helvetica,sans-serif;\"><em>( Fasilitas dan properti yang dimaksud Kendaraan Dinas Bermotor, Komputer Utama )</em></span><!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#418\" data-toggle=\"modal\" type=\"button\">?</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung--></p>\n\n<div aria-hidden=\"true\" aria-labelledby=\"exampleModalLabel\" class=\"modal fade\" id=\"418\" tabindex=\"-1\">\n<div class=\"modal-dialog\">\n<div class=\"modal-content\">\n<div class=\"modal-header\">\n<h5 class=\"modal-title font-weight-bold\" id=\"exampleModalLabel\"><strong>Konsep dan Definisi</strong></h5>\n</div>\n<!--Yang di dalam modal-body untuk isinya (ini yang diganti)-->\n\n<div class=\"modal-body\">\n<p>Komputer utama yang dimaksud merupakan komputer yang menyimpan semua data penting satuan kerja tersebut. Isikan Ya jika memiliki Tata letak dan lokasi khusus. Tata letak adalah penggunaan sarana atau peralatan pendukung yang tepat untuk efisiensi penanganan bencana. Lokasi khusus yaitu lokasi penyimpanan yang aman dari bencana.</p>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-primary\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 29, 'en', 0, 0, '1', ''),
(24, 0, 423492, 4, 'F', 'R3B04Q018', '<p>Saat ini, apakah satuan kerja Bapak/Ibu/Saudara/i memiliki tata letak dan lokasi khusus untuk melindungi fasilitas dan properti khusus ketika terjadi bencana?</p>\n\n<p><span style=\"font-family:Trebuchet MS,Helvetica,sans-serif;\"><em>( Fasilitas dan properti yang dimaksud Kendaraan Dinas Bermotor, Komputer Utama )</em></span><button class=\"kondef\" data-target=\"#418\" data-toggle=\"modal\" type=\"button\">?</button></p>\n\n<p>\n<style type=\"text/css\">.kondef {\n        margin-left: 10px;\n        width: 20px;\n        height: 20px;\n        border-radius: 50%;\n        outline: none;\n        border: none;\n        color: white;\n        background-color: #072438;\n    }\n\n    .kondef:focus {\n        outline: none;\n        border: none;\n    }\n\n    .kondef:active {\n        outline: none;\n        border: none;\n    }\n</style>\n<!--data-target harus beda tiap kondef, gaboleh sama--><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung--></p>\n\n<div aria-hidden=\"true\" aria-labelledby=\"exampleModalLabel\" class=\"modal fade\" id=\"418\" tabindex=\"-1\">\n<div class=\"modal-dialog\">\n<div class=\"modal-content\">\n<div class=\"modal-header\">\n<h5 class=\"modal-title font-weight-bold\" id=\"exampleModalLabel\"><strong>Konsep dan Definisi</strong></h5>\n</div>\n<!--Yang di dalam modal-body untuk isinya (ini yang diganti)-->\n\n<div class=\"modal-body\">\n<p>Komputer utama yang dimaksud merupakan komputer yang menyimpan semua data penting satuan kerja tersebut. Isikan Ya jika memiliki Tata letak dan lokasi khusus. Tata letak adalah penggunaan sarana atau peralatan pendukung yang tepat untuk efisiensi penanganan bencana. Lokasi khusus yaitu lokasi penyimpanan yang aman dari bencana.</p>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-primary\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 29, 'id', 0, 0, '1', ''),
(25, 0, 423492, 4, 'X', 'R3B04Q017', 'Apakah satuan kerja Bapak/Ibu/Saudara/I melakukan perawatan dan pengecekan fasilitas dan properti secara berkala yang bertujuan untuk mencegah terjadinya kerusakan?\n<style type=\"text/css\">.kondef {\n        margin-left: 10px;\n        width: 20px;\n        height: 20px;\n        border-radius: 50%;\n        outline: none;\n        border: none;\n        color: white;\n        background-color: #072438;\n    }\n\n    .kondef:focus {\n        outline: none;\n        border: none;\n    }\n\n    .kondef:active {\n        outline: none;\n        border: none;\n    }\n</style>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#417\" data-toggle=\"modal\" type=\"button\">?</button> <!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n<div aria-hidden=\"true\" aria-labelledby=\"exampleModalLabel\" class=\"modal fade\" id=\"417\" tabindex=\"-1\">\n<div class=\"modal-dialog\">\n<div class=\"modal-content\">\n<div class=\"modal-header\">\n<h5 class=\"modal-title font-weight-bold\" id=\"exampleModalLabel\"><strong>Konsep dan Definisi</strong></h5>\n</div>\n<!--Yang di dalam modal-body untuk isinya (ini yang diganti)-->\n\n<div class=\"modal-body\">\n<ul>\n	<li>Atap yang dimaksud adalah atap terluas yang merupakan penutup bagian atas bangunan. Untuk bangunan bertingkat, atap yang dimaksud adalah bagian teratas dari bangunan tersebut.</li>\n	<li>Dinding (sudah jelas)</li>\n	<li>Jendela, Pintu, dan Gerbang (sudah jelas)</li>\n	<li>Tangga dan Lantai (sudah jelas)</li>\n	<li>Penerangan adalah sistem tata cahaya untuk penerangan yang digunakan pada gedung.</li>\n	<li>Pipa Saluran Air yang dimaksud adalah pipa yang berada pada saluran pemeliharaan air kotor maupun pada saluran air bersih</li>\n	<li>Pendinginan yang dimaksud adalah pendinginan pada sistem tata udara yang digunakan pada gedung.</li>\n	<li>Kontrol Akses adalah sistem integrasi fasilitas atau properti pada gedung. contohnya penggunaan sistem alarm kebakaran yang selain dapat mengaktifkan alat penyiram juga dapat menonaktifkan beberapa pintu akses, jaringan Wifi, CCTV, dan sejenisnya.</li>\n</ul>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-primary\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'N', 12, 'en', 0, 0, '1', ''),
