(26, 0, 423492, 4, 'L', 'R3B04Q019', '<p>Saat ini, apakah satuan kerja Bapak/Ibu/Saudara/I menyimpan dokumen penting di tempat khusus yang aman?\n<style type=\"text/css\">.kondef {\n        margin-left: 10px;\n        width: 20px;\n        height: 20px;\n        border-radius: 50%;\n        outline: none;\n        border: none;\n        color: white;\n        background-color: #072438;\n    }\n\n    .kondef:focus {\n        outline: none;\n        border: none;\n    }\n\n    .kondef:active {\n        outline: none;\n        border: none;\n    }\n</style>\n</p>\n\n<p><span style=\"font-family:Trebuchet MS,Helvetica,sans-serif;\"><em>( Misalnya: brankas atau lemari khusus )</em></span><em><!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#419\" data-toggle=\"modal\" type=\"button\">?</button> </em><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung--></p>\n\n<div aria-hidden=\"true\" aria-labelledby=\"exampleModalLabel\" class=\"modal fade\" id=\"419\" tabindex=\"-1\">\n<div class=\"modal-dialog\">\n<div class=\"modal-content\">\n<div class=\"modal-header\">\n<h5 class=\"modal-title font-weight-bold\" id=\"exampleModalLabel\"><strong>Konsep dan Definisi</strong></h5>\n</div>\n<!--Yang di dalam modal-body untuk isinya (ini yang diganti)-->\n\n<div class=\"modal-body\">\n<p>Dokumen penting yang dimaksud adalah surat-surat tertulis atau tercetak yang dapat dipakai sebagai bukti keterangan dan berisikan informasi-informasi penting yang berkaitan dengan Satuan Kerja BPS tersebut, misalnya dokumen pegawai, hasil survey, dan sejenisnya.</p>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-primary\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 30, 'en', 0, 0, '1', ''),
