(29, 0, 423492, 7, 'L', 'R3B04Q001', '<p style=\"text-align: justify;\">Dalam setahun terakhir, apakah satuan kerja Bapak/Ibu/Saudara/i pernah melakukan pelatihan mitigasi dan kesiapsiagaan bencana alam (simulasi/gladi peringatan bencana, sosialisasi, dan lainnya)?</p>\n\n<p><!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b04q001\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung--></p>\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b04q001\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\"></span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<p>Pelatihan kesiapsiagaan bencana adalah bentuk latihan koordinasi, komunikasi dan evakuasi dengan melibatkan seluruh pemangku kepentingan (pemerintah dan masyarakat umum). Pelatihan mitigasi dan kesiapsiagaan bencana dapat melalui seminar, sosialisasi, dan lain-lain.</p>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 1, 'en', 0, 0, '1', ''),
(29, 0, 423492, 7, 'L', 'R3B04Q001', '<p style=\"text-align: justify;\">Dalam setahun terakhir, apakah satuan kerja Bapak/Ibu/Saudara/i pernah melakukan pelatihan mitigasi dan kesiapsiagaan bencana alam (simulasi/gladi peringatan bencana, sosialisasi, dan lainnya)?</p>\n\n<p><!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b04q001\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung--></p>\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b04q001\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\"></span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<p>Pelatihan kesiapsiagaan bencana adalah bentuk latihan koordinasi, komunikasi dan evakuasi dengan melibatkan seluruh pemangku kepentingan (pemerintah dan masyarakat umum). Pelatihan mitigasi dan kesiapsiagaan bencana dapat melalui seminar, sosialisasi, dan lain-lain.</p>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 1, 'id', 0, 0, '1', ''),
(30, 0, 423492, 7, 'L', 'R3B04Q004', '<p style=\"text-align: justify;\">Saat ini, apakah satuan kerja Bapak/Ibu/Saudara/imemiliki kebijakan khusus bagi kelompok rentan terkait kebencanaan? (misalnya saat terjadi bencana, kelompok rentan didahulukan)</p>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b04q004\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b04q004\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\"></span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<p>Cakupan dari kelompok rentan:</p>\n\n<ul>\n	<li>Lanjut usia (lansia) adalah seseorang yang telah mencapai usia 60 tahun keatas.</li>\n	<li>Wanita hamil/ibu hamil adalah seorang perempuan yang sedang mengandung .</li>\n	<li>Penyandang disabilitas, meliputi penyandang disabilitas fisik (contoh : tidak dapat berjalan seperti orang normal, tuna rungu) dan gangguan perilaku/emosional.</li>\n</ul>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 4, 'id', 0, 0, '1', ''),
