(32, 0, 423492, 7, 'L', 'R3B04Q005', '<p style=\"text-align: justify;\">Saat ini, apakah satuan kerja Bapak/Ibu/Saudara/i terdapat koordinasi dan kerjasama dengan institusi lain terkait kebencanaan?</p>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b04q005\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b04q005\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\"></span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<p>Isikan Ya jika Satuan Kerja Anda melakukan koordinasi dan kerjasama dengan institusiyang berhubungan dengan kebencanaan, seperti BNPB/BPBD, BPJS, Pemadam Kebakaran, Dinas Kesehatan, dan lain-lain. Contohnya koordinasi dalam mengadakan pelatihan mitigasi dan kesiapsiagaan bencana</p>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 5, 'id', 0, 0, '1', ''),
