(43, 0, 423492, 5, 'L', 'R3B05Q001', '<p>Selama pandemi COVID-19, apakah satuan kerja Bapak/Ibu/Saudara/i pernah melakukan pelatihan mitigasi mengenai Covid-19 ?</p>\n\n<p>(simulasi/gladi peringatan bencana, sosialisasi, dan lainnya)?</p>\n', '', '<p><span lang=\"en\" style=\"font-size:12pt;\" xml:lang=\"en\"><span style=\"line-height:115%;\"><span style=\"font-family:\'Times New Roman\', serif;\">Isikan \"Ya\" apabila satuan kerja responden pernah melakukan pelatihan mitigasi COVID-19 melalui seminar,sosialisasi, dan lain-lain</span></span></span></p>\n', 'N', 'Y', 1, 'id', 0, 0, '1', ''),
