(44, 0, 423492, 7, 'L', 'R3B04Q003', '<p style=\"text-align: justify;\">Saat ini, apakah satuan kerja Bapak/Ibu/Saudara/i memiliki prosedur tetap (protap) evakuasi?</p>\n<!--data-target harus beda tiap kondef, gaboleh sama--><button class=\"kondef\" data-target=\"#r3b04q003\" data-toggle=\"modal\" type=\"button\">Penjelasan</button><!--id pada tag di bawah harus disamakan dengan data-target tanpa tanda # kurung-->\n\n<div aria-labelledby=\"myModalLabel\" class=\"modal fade\" id=\"r3b04q003\" role=\"dialog\" tabindex=\"-1\">\n<div class=\"modal-dialog\" role=\"document\">\n<div class=\"modal-content\">\n<div class=\"modal-header\"><button aria-label=\"Close\" class=\"close\" data-dismiss=\"modal\" type=\"button\"><span aria-hidden=\"true\"></span></button>\n\n<h4 class=\"modal-title\" id=\"myModalLabel\">Konsep dan Definisi</h4>\n</div>\n\n<div class=\"modal-body\">\n<p>Prosedur evakuasi adalah pedoman seluruh pegawai untuk mengatasi secara dini kemungkinan terjadinya bencana, menghindari timbulnya kepanikan, dan mencegah tindakan-tindakan yang dapat menimbulkan kerugian yang lebih besar baik jiwa maupun aset kantor.</p>\n</div>\n\n<div class=\"modal-footer\"><button class=\"btn btn-default\" data-dismiss=\"modal\" type=\"button\">Close</button></div>\n</div>\n</div>\n</div>\n', '', '', 'N', 'Y', 3, 'en', 0, 0, '1', ''),
