(423492, 'en', 'Sensus Mitigasi dan Kesiapsiagaan Terhadap Bencana Satuan Kerja Badan Pusat Statistik (BPS) di Seluruh Indonesia', '<p style=\"text-align:center;\">Sensus ini merupakan suatu kegiatan pencacahan data secara lengkap terhadap satuan kerja BPS di seluruh Indonesia yang bertujuan untuk menyediakan data tingkat mitigasi dan kesiapsiagaan bencana masing-masing BPS di seluruh Indonesia. Bencana yang tercakup dalam sensus ini adalah bencana alam dan nonalam (kebakaran dan COVID-19) yang akan disajikan dalam bentuk indeks komposit yang dinamakan dengan Indeks Mitigasi dan Kesiapsiagaan Bencana (IMKB) Satuan kerja BPS. Indeks tersebut dibangun oleh berbagai dimensi, indikator, dan variabel yang berkaitan dengan mitigasi dan kesiapsiagaan bencana. Selain itu, sensus ini juga bertujuan untuk mengetahui determinan apa saja yang memengaruhi tingkat mitigasi dan kesiapsiagaan bencana di BPS di seluruh Indonesia. Harapannya, dari informasi yang disajikan dapat berguna sebagai dasar untuk pengembangan dan perbaikan kebijakan terkait mitigasi dan kesiapsiagaan terhadap bencana di BPS.</p>\n', '<p style=\"text-align:center;\"><strong>PRAKTIK KERJA LAPANGAN POLITEKNIK STATISTIKA STIS TAHUN 2020/2021</strong></p>\n', '<h3 style=\"text-align: center;\">Kami mengucapkan terima kasih banyak kepada Bapak/Ibu atas kesediaannya mengisi kuesioner ini. Jawaban yang Bapak/Ibu berikan sangat berguna bagi kelancaran PKL Politeknik Statistika STIS T.A 2020/2021 yang bertema Menuju BPS yang Lebih Baik ( <em>Towards Better BPS</em> ). Semoga Bapak/Ibu sekeluarga sehat selalu.</h3>\n\n<p style=\"text-align:center;\"></p>\n\n<p style=\"text-align:center;\"><strong>PRAKTIK KERJA LAPANGAN POLITEKNIK STATISTIKA STIS TAHUN 2020/2021</strong></p>\n', '', '', '', '', '', 'Invitation to participate in a survey', 'Dear {FIRSTNAME},<br /><br />\nyou have been invited to participate in a survey.<br /><br />\nThe survey is titled:<br />\n\"{SURVEYNAME}\"<br /><br />\n\"{SURVEYDESCRIPTION}\"<br /><br />\nTo participate, please click on the link below.<br /><br />\nSincerely,<br /><br />\n{ADMINNAME} ({ADMINEMAIL})<br /><br />\n----------------------------------------------<br />\nClick here to do the survey:<br />\n{SURVEYURL}<br /><br />\nIf you do not want to participate in this survey and don\'t want to receive any more invitations please click the following link:<br />\n{OPTOUTURL}<br /><br />\nIf you are blacklisted but want to participate in this survey and want to receive invitations please click the following link:<br />\n{OPTINURL}', 'Reminder to participate in a survey', 'Dear {FIRSTNAME},<br /><br />\nRecently we invited you to participate in a survey.<br /><br />\nWe note that you have not yet completed the survey, and wish to remind you that the survey is still available should you wish to take part.<br /><br />\nThe survey is titled:<br />\n\"{SURVEYNAME}\"<br /><br />\n\"{SURVEYDESCRIPTION}\"<br /><br />\nTo participate, please click on the link below.<br /><br />\nSincerely,<br /><br />\n{ADMINNAME} ({ADMINEMAIL})<br /><br />\n----------------------------------------------<br />\nClick here to do the survey:<br />\n{SURVEYURL}<br /><br />\nIf you do not want to participate in this survey and don\'t want to receive any more invitations please click the following link:<br />\n{OPTOUTURL}', 'Survey registration confirmation', 'Dear {FIRSTNAME},<br /><br />\nYou, or someone using your email address, have registered to participate in an online survey titled {SURVEYNAME}.<br /><br />\nTo complete this survey, click on the following URL:<br /><br />\n{SURVEYURL}<br /><br />\nIf you have any questions about this survey, or if you did not register to participate and believe this email is in error, please contact {ADMINNAME} at {ADMINEMAIL}.', 'Confirmation of your participation in our survey', 'Dear {FIRSTNAME},<br /><br />\nthis email is to confirm that you have completed the survey titled {SURVEYNAME} and your response has been saved. Thank you for participating.<br /><br />\nIf you have any further questions about this email, please contact {ADMINNAME} on {ADMINEMAIL}.<br /><br />\nSincerely,<br /><br />\n{ADMINNAME}', 1, '{\"attribute_1\":\"\",\"attribute_2\":\"\",\"attribute_3\":\"\",\"attribute_4\":\"\"}', 'Response submission for survey {SURVEYNAME}', 'Hello,<br /><br />\nA new response was submitted for your survey \'{SURVEYNAME}\'.<br /><br />\nClick the following link to see the individual response:<br />\n{VIEWRESPONSEURL}<br /><br />\nClick the following link to edit the individual response:<br />\n{EDITRESPONSEURL}<br /><br />\nView statistics by clicking here:<br />\n{STATISTICSURL}', 'Response submission for survey {SURVEYNAME} with results', 'Hello,<br /><br />\nA new response was submitted for your survey \'{SURVEYNAME}\'.<br /><br />\nClick the following link to see the individual response:<br />\n{VIEWRESPONSEURL}<br /><br />\nClick the following link to edit the individual response:<br />\n{EDITRESPONSEURL}<br /><br />\nView statistics by clicking here:<br />\n{STATISTICSURL}<br /><br /><br />\nThe following answers were given by the participant:<br />\n{ANSWERTABLE}', 0, NULL),
(423492, 'id', 'Sensus Mitigasi dan Kesiapsiagaan Terhadap Bencana Satuan Kerja Badan Pusat Statistik (BPS) di Seluruh Indonesia', '<p style=\"text-align:center;\">Sensus ini merupakan suatu kegiatan pencacahan data secara lengkap terhadap satuan kerja BPS di seluruh Indonesia yang bertujuan untuk menyediakan data tingkat mitigasi dan kesiapsiagaan bencana masing-masing BPS di seluruh Indonesia. Bencana yang tercakup dalam sensus ini adalah bencana alam dan nonalam (kebakaran dan COVID-19) yang akan disajikan dalam bentuk indeks komposit yang dinamakan dengan Indeks Mitigasi dan Kesiapsiagaan Bencana (IMKB) Satuan kerja BPS. Indeks tersebut dibangun oleh berbagai dimensi, indikator, dan variabel yang berkaitan dengan mitigasi dan kesiapsiagaan bencana. Selain itu, sensus ini juga bertujuan untuk mengetahui determinan apa saja yang memengaruhi tingkat mitigasi dan kesiapsiagaan bencana di BPS di seluruh Indonesia. Harapannya, dari informasi yang disajikan dapat berguna sebagai dasar untuk pengembangan dan perbaikan kebijakan terkait mitigasi dan kesiapsiagaan terhadap bencana di BPS.</p>\n', '<p style=\"text-align:center;\"><strong>PRAKTIK KERJA LAPANGAN POLITEKNIK STATISTIKA STIS TAHUN 2020/2021</strong></p>\n', '<p style=\"text-align:center;\"><strong>PRAKTIK KERJA LAPANGAN POLITEKNIK STATISTIKA STIS TAHUN 2020/2021</strong></p>\n', '', '', '', '', '', 'Undangan untuk berpartisipasi dalam survei', '{FIRSTNAME} yang terhormat,<br /><br />\nAnda diundang untuk berpartisipasi dalam sebuah survei.<br /><br />\nSurvei tersebut berjudul:<br />\n\"{SURVEYNAME}\"<br /><br />\n\"{SURVEYDESCRIPTION}\"<br /><br />\nUntuk berpartisipasi, harap klik alamat di bawah ini.<br /><br />\nHormat kami,<br /><br />\n{ADMINNAME} ({ADMINEMAIL})<br /><br />\n----------------------------------------------<br />\nKlik di sini untuk mengisi survei:<br />\n{SURVEYURL}<br /><br />\nJika Anda tidak ingin berpartisipasi dalam survei ini dan tidak ingin menerima undangan lagi, harap klik tautan ini:<br />\n{OPTOUTURL}<br /><br />\nJika Anda masuk dalam daftar hitam, namun ingin menerima undangan dan berpartisipasi pada survei ini silakan klik pada tautan berikut:<br />\n{OPTINURL}', 'Pengingat untuk berpartisipasi dalam survei', '{FIRSTNAME} yang terhormat,<br /><br />\nBeberapa waktu lalu, kami mengundang Anda untuk berpartisipasi dalam sebuah survei.<br /><br />\nKami lihat Anda belum mengisi survei tersebut dan kami ingin mengingatkan Anda bahwa survei tersebut masih tersedia jika Anda ingin ambil bagian.<br /><br />\nSurvei tersebut berjudul:<br />\n\"{SURVEYNAME}\"<br /><br />\n\"{SURVEYDESCRIPTION}\"<br /><br />\nUntuk berpartisipasi, silahkan klik pada alamat di bawah ini.<br /><br />\nHormat kami,<br /><br />\n{ADMINNAME} ({ADMINEMAIL})<br /><br />\n----------------------------------------------<br />\nKlik di sini untuk mengisi survei:<br />\n{SURVEYURL}<br /><br />\nJika Anda tidak ingin berpartisipasi dalam survei ini dan tidak ingin menerima undangan lagi, harap klik tautan ini:<br />\n{OPTOUTURL}', 'Konfirmasi pendaftaran survei', '{FIRSTNAME} yang terhormat,<br /><br />\nAnda, atau seseorang menggunakan alamat email Anda, telah mendaftar untuk berpartisipasi dalam survei online berjudul {SURVEYNAME}.<br /><br />\nUntuk melengkapi survei ini, silahkan klik pada alamat URL berikut:<br /><br />\n{SURVEYURL}<br /><br />\nSekiranya Anda ingin bertanya tentang survei ini, atau bila Anda belum terdaftar dan merasa ada kesalahan pada email ini, mohon hubungi {ADMINNAME} di alamat {ADMINEMAIL}.', 'Konfirmasi partisipasi Anda dalam survei kami', '{FIRSTNAME} yang kami hormati,<br /><br />\nSurel ini merupakan konfirmasi bahwa Anda telah menyelesaikan survei dengan judul {SURVEYNAME} dan jawaban Anda telah disimpan. Terima kasih atas partisipasi Anda.<br /><br />\nJika Anda memiliki pertanyaan lebih lanjut yang terkait dengan surel ini, harap hubungi {ADMINNAME} pada alamat {ADMINEMAIL}.<br /><br />\nHormat kami,<br /><br />\n{ADMINNAME}', 5, '{\"attribute_1\":\"\",\"attribute_2\":\"\",\"attribute_3\":\"\",\"attribute_4\":\"\"}', 'Pengiriman tanggapan untuk survei {SURVEYNAME}', 'Halo,<br /><br />\nSuatu tanggapan telah dikirimkan untuk survei \'{SURVEYNAME}\' Anda.<br /><br />\nKlik tautan berikut untuk memuat ulang survei:<br />\n{RELOADURL}<br /><br />\nKlik tautan berikut untuk melihat tanggapan individu:<br />\n{VIEWRESPONSEURL}<br /><br />\nKlik tautan berikut untuk mengedit tanggapan individu:<br />\n{EDITRESPONSEURL}<br /><br />\nLihat statistik dengan klik tautan berikut:<br />\n{STATISTICSURL}', 'Kiriman tanggapan untuk survei {SURVEYNAME} dengan hasil', 'Halo,<br /><br />\nSebuah tanggapan telah dikirimkan untuk survei \'{SURVEYNAME}\' Anda.<br /><br />\nKlik tautan berikut untuk memuat ulang survei:<br />\n{RELOADURL}<br /><br />\nKlik tautan berikut untuk melihat tanggapan individu:<br />\n{VIEWRESPONSEURL}<br /><br />\nKlik tautan berikut untuk mengedit tanggapan individu:<br />\n{EDITRESPONSEURL}<br /><br />\nLihat statistik dengan klik tautan berikut:<br />\n{STATISTICSURL}<br /><br /><br />\nJawaban berikut diberikan oleh partisipan:<br />\n{ANSWERTABLE}', 0, NULL);
